import React, { useState, useEffect } from "react";
import { Form, Button } from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.min.css";
import "../css/signup.css";
import { signInWithEmailAndPassword } from "firebase/auth";
import fire from "./Base";
import { useNavigate } from "react-router-dom";
const Login = () => {
  const [emaillogin, setEmaillogin] = useState();
  const [passwordlogin, setPasswordlogin] = useState();

  let navigate = useNavigate();

  useEffect(() => {
    let Authtoken = localStorage.getItem("Auth key");
    if (Authtoken) {
      navigate("/home");
    }
  }, [navigate]);
  const Handlelogin = () => {
    // const auth = getAuth();
    signInWithEmailAndPassword(fire, emaillogin, passwordlogin)
      .then((user) => {
        // console.log("Login successfully", user._tokenResponse.refreshToken)
        localStorage.setItem("Auth key", user._tokenResponse.refreshToken);
        navigate("/home");
      })
      .catch((error) => {
        console.log(error);
      });
  };

  return (
    <>
      <div className="Signup">
        <Form className="card">
          <h3 className="header">Login</h3>
          <Form.Group size="lg" controlId="email">
            <Form.Label>Email</Form.Label>
            <Form.Control
              autoFocus
              onChange={(e) => setEmaillogin(e.target.value)}
              type="email"
              name="email"
            />
          </Form.Group>

          <Form.Group size="lg" controlId="password">
            <Form.Label>Password</Form.Label>
            <Form.Control
              onChange={(e) => setPasswordlogin(e.target.value)}
              type="password"
              name="password"
            />
          </Form.Group>
          <br />

          <Button size="lg" onClick={Handlelogin}>
            Login
          </Button>
        </Form>
      </div>
    </>
  );
};

export default Login;
